import { useState, useEffect, useRef } from "react";
import { Link, useNavigate } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";
import { logout } from "../redux/slices/authSlice"; // adjust path if needed

export default function Header() {
  const { userInfo } = useSelector((state) => state.auth);
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const [menuOpen, setMenuOpen] = useState(false);
  const menuRef = useRef(null);

  const handleLogout = () => {
    dispatch(logout());
    navigate("/");
  };

  // Close dropdown if clicked outside
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (menuRef.current && !menuRef.current.contains(event.target)) {
        setMenuOpen(false);
      }
    };
    document.addEventListener("click", handleClickOutside);
    return () => document.removeEventListener("click", handleClickOutside);
  }, []);

  return (
    <div className="header-container">
      <div className="container-fluid">
        <div className="header">
          {/* ✅ Logo */}
          <div className="logo">
            <Link to="/">
              <img
                src={`${process.env.PUBLIC_URL}/assets/images/aayologo.png`}
                alt="Aayo"
              />
            </Link>
          </div>

          {/* ✅ Navigation Menu */}
          <div className="nav">
            <ul>
              <li>
                <Link
                  to="/"
                  className={({ isActive }) => (isActive ? "active" : "")}
                >
                  Home
                </Link>
              </li>
              <li>
                <Link to="/features">Features</Link>
              </li>
              <li>
                <Link to="/about">About Us</Link>
              </li>
              <li>
                <Link to="/how-it-works">How It Works</Link>
              </li>
              <li>
                <Link to="/faq">FAQ</Link>
              </li>
              <li>
                <Link to="/contact">Contact Us</Link>
              </li>
            </ul>
          </div>

          {/* ✅ Right Section */}
          <div className="button" ref={menuRef}>
            {!userInfo ? (
              <>
                <Link to="/login" className="btn btn-blank">
                  Sign In
                </Link>
                <Link to="/login" className="btn btn-fill">
                  Sign Up
                </Link>
              </>
            ) : (
              <div className="button">
                <button
                  className="btn btn-blank usermenu-toggle"
                  onClick={() => setMenuOpen((prev) => !prev)}
                >
                  <img
                    src={
                      userInfo?.avatar ||
                      `${process.env.PUBLIC_URL}/assets/images/thumb-driver.png`
                    }
                    alt={userInfo?.name || "User"}
                    style={{
                      width: "32px",
                      height: "32px",
                      borderRadius: "50%",
                    }}
                  />
                  {userInfo?.name || "User"}{" "}
                  <span className="material-icons-outlined">
                    arrow_drop_down
                  </span>
                </button>

                {/* ✅ Dropdown Menu */}
                {menuOpen && (
                  <div className="usermenu-toggle-content">
                    <ul>
                      <li>
                        <Link to="/profile" onClick={() => setMenuOpen(false)}>
                          Profile
                        </Link>
                      </li>
                      <li>
                        <Link
                          to="/change-password"
                          onClick={() => setMenuOpen(false)}
                        >
                          Change Password
                        </Link>
                      </li>
                      <li>
                        <button
                          onClick={() => {
                            setMenuOpen(false);
                            handleLogout();
                          }}
                          className="btn-link"
                        >
                          Sign Out
                        </button>
                      </li>
                    </ul>
                  </div>
                )}
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}
